#Jellyfish are among the largest #holoplankton, often growing large enough to be seen without magnification. Other holoplankton include several types of #crustaceans including the two kinds of copepods seen here, euphausiids (krill), and amphipods like the one above. These are just a few examples of the huge variety of animals in this group. We‚Äôve also got a tunicate (the larvacean) in the mix here!

These microfauna (tiny animals) are among the most important in the #sea because they make up a big part of the diets of some of our favorite charismatic #macrofauna (large animals). Baleen #whales (like Humpback Whales) can consume up to 3,000 pounds of food daily, much of which consists of euphausiids! Copepods and other zoops are important prey for juvenile #Salmon and other forage fish that live in #PugetSound. Larvaceans create and shed several gelatinous ‚Äòhouses‚Äô each day- these discarded ‚Äòhouses‚Äô provide food for some marine animals and collect organic and inorganic debris as they slowly sink to the seafloor, contributing to marine snow (check out our post on what this is and why it‚Äôs important!).

These are just a few examples of why these tiny creatures are such an important component of the Puget Sound #ecosystem. Be sure to check out our zooplankton monitoring page to learn more about this program! #linkinbio If you need more zooplankton photos, please check out our online galleries (search ‚ÄòKing County marine life photos).

Photos: Lyndsey Swanson, Gabriela Hannach

